(34, 'Louis Tomlinson', 359681, 78, 'https://i.scdn.co/image/ab37587d36dd8a2de8c1455c523049cd5343dd1f', 'https://i.scdn.co/image/4a8c14ea8bdbd5e3d37420328f20efd7ffe1d716', 0, '2017-07-31 11:23:56', '{"bio":"Louis William Tomlinson (born Louis Troy Austin; 24 December 1991) is an English singer and songwriter. He is known as a member of the boy band One Direction.\\nTomlinson began his career as an actor, initially appearing in ITV drama Fat Friends as an extra. He also went on to appear in another ITV drama film If I Had You and the BBC drama Waterloo Road. In 2010, he became a founding member of One Direction after auditioning as a solo artist on The X Factor, and also one of the main songwriters of their repertoire. Following the band''s hiatus, Tomlinson released the singles \\"Just Hold On\\" and \\"Back to You\\". The latter will be included in his debut studio album, which will be released in 2017 by Epic Records.\\nIn 2013, he was signed as a footballer by Doncaster Rovers of the Football League Championship on a non-contract basis. The same year he also formed his own record label, Triple Strings Ltd. He appeared on Debrett''s 2017 list of the most influential people in the UK.","images":[{"url":"https:\\/\\/upload.wikimedia.org\\/wikipedia\\/commons\\/4\\/43\\/Harry_Styles%2C_Liam_Payne_and_Louis_Tomlinson_X_Factor_Live_Glasgow.jpg"},{"url":"https:\\/\\/upload.wikimedia.org\\/wikipedia\\/commons\\/6\\/6a\\/Louis_Tomlinson_November_2014.jpg"},{"url":"https:\\/\\/upload.wikimedia.org\\/wikipedia\\/commons\\/d\\/df\\/Louischarityfootball5.jpg"},{"url":"https:\\/\\/upload.wikimedia.org\\/wikipedia\\/commons\\/7\\/78\\/Louischarityfootball8.jpg"}]}', NULL, NULL),
